{"operationName":"StarredSpacesQuery","variables":{},"query":"query StarredSpacesQuery {
  spaces(favourite: true, first: 99) {
    nodes {
      ...SpaceFragment
      __typename
    }
    __typename
  }
}

fragment SpaceFragment on Space {
  id
  name
  key
  icon {
    path
    __typename
  }
  __typename
}
"}

{"operationName":"RecentSpacesQuery","variables":{"selectedSpaceKey":"INT"},"query":"query RecentSpacesQuery {
  recentSpaces {
    ...SpaceFragment
    __typename
  }
}

fragment SpaceFragment on Space {
  id
  name
  key
  icon {
    path
    __typename
  }
  __typename
}
"}

{"operationName":"RecentlyViewedQuery","variables":{"cloudId":"0d13b137-2934-4b74-a921-694ab83c54c5","first":25,"after":""},"query":"query RecentlyViewedQuery($cloudId: ID!, $first: Int, $after: String) {
  activities {
    myActivities {
      viewed(filters: [{type: AND, arguments: {products: [CONFLUENCE], objectTypes: [PAGE, BLOGPOST], cloudIds: [$cloudId]}}], first: $first, after: $after) {
        edges {
          node {
            id
            timestamp
            object {
              id
              url
              content {
                ...PageContentFragment
                __typename
              }
              __typename
            }
            __typename
          }
          cursor
          __typename
        }
        pageInfo {
          hasNextPage
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment PageContentFragment on Content {
  id
  type
  title
  status
  metadata {
    currentuser {
      favourited {
        isFavourite
        __typename
      }
      __typename
    }
    __typename
  }
  space {
    id
    key
    name
    __typename
  }
  __typename
}
"}
